import * as React from 'react';
import TextField from '@mui/material/TextField';
import {Container, Grid, Paper, Button} from '@mui/material';

export default function AdminReultListInputBox() {
    const [value, setValue] = React.useState();
    const [interText, setInter] = React.useState(row.inter);

    const handleChange = (event) => {
        setValue(event.target.value);
    }

    return(
        <Container component="main">
            <Paper
            sx={{
                p: 2,
                margin: 'auto',
                maxWidth: 500,
                flexGrow: 1,
                backgroundColor: (theme) =>
                theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
            }}
            >
            <Grid
            sx={{
                display: 'flex',
                flexDirection: 'column',
                alignItems: 'center',
            }}>
                <TextField
            id="cont"
            label="신청 내용"
            multiline
            rows={12}
            name="inter"
            placeholder="오른쪽 귀가 자꾸 먹먹하고 잘 안들리는 경우가 많습니다. 
            또한 씻고 난 후 귀에서 진물이 나오는 경우가 종종 있습니다."
            fullWidth
            sx={{mt : 3}}
            value={value}
            onChange={handleChange}
            />

            <Button variant='contained' sx={{mt: 3}}>제출하기</Button>
            </Grid>
        </Paper>
        </Container>
    );
}
